import 'bootstrap/dist/css/bootstrap.css';
import { Navbar } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Navbar bg="dark">
        <Navbar.Brand>LOGO</Navbar.Brand>
      </Navbar>
    </div>
  );
}

export default App;
